import './App.css';
import NavBar from './NavBar';

function App() {
  return (
    <div>
      <NavBar></NavBar>
      <div style={{
          textAlign: "left", //글자 가로 가운데 정렬
          lineHeight: "10vh", //글자 세로 가운데 정렬
          fontSize: "20px", 
          color: "#F5F1F1",
          background: "#E9AC06",
          height: "400px",
          width: "100%",
      }}>wleh</div>
    </div>
  );
}

export default App;
